const blockStyle = {
    root: {
        padding: "10px",
    },
    flexDiv1: {
        display: "flex",
        justifyContent: "space-around"
    },
    card: {
        width: "100%",
        backgroundColor: "#ffffff",
        textAlign: "center",
    },
    title: {
        fontSize: 14,
    },
    pos: {
        marginBottom: 12,
    },
}
export default blockStyle;
